```python
class Queue:
    # The queue.
    def __init__(self):
        self.empty = False
        self.size = 0
    def enqueue(self, item):
        self.size += 1
        self.append(item)
    def dequeue(self):
        if not self.empty:
            self.remove()
            self.size -= 1
    def clear(self):
        self.empty = True
    def pop(self):
        if not self.empty:
            return self.dequeue()
        else:
            raise ValueError("Queue is empty")
```

